INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Michelle Monaghan', '1976-03-23', 'Winthrop, Iowa, USA', 'nm1157358', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTU2MjI3NzA1N15BMl5BanBnXkFtZTgwNzIzOTE4MDI@._V1_.jpg', 'Michelle Lynn Monaghan was born on March 23, 1976, in Winthrop, Iowa. She is the youngest of three children and the only daughter of Sharon (Hamel), who ran a day care center, and Robert L. Monaghan, a factory worker and farmer. She is of mostly Irish and German descent.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Dermot Mulroney', '1963-10-31', 'Alexandria, Virginia, USA', 'nm0000551', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMzM2ODM3NTc3NF5BMl5BanBnXkFtZTYwOTYwMzM0._V1_.jpg', 'Dermot Mulroney was born in Alexandria, Virginia, to Ellen and Michael Mulroney, a law professor at Villanova. Since being discovered at Northwestern University by a Hollywood talent agent 28 years ago, Mulroney has been seen in over 70 films. Mulroney is a classically trained cellist who began playing in Alexandria, Virginia\'s public school system when he was 7 years old.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('David Harbour', '1975-04-10', 'New York, USA', 'nm1092086', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTM1MDkxMTY2N15BMl5BanBnXkFtZTcwNTcxMjAyMg@@._V1_.jpg', 'David Harbour is an American actor who has performed in film, television, and the theater.He is known for his role as CIA agent Gregg Beam in "Quantum of Solace", Shep Campbell in "Revolutionary Road", Van Hauser in "End of Watch" and Dexter Tolliver in "Suicide Squad".');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Jamie Foxx', '1967-12-13', 'Terrell, Texas, USA', 'nm0004937', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTkyNjY1NDg3NF5BMl5BanBnXkFtZTgwNjA2MTg0MzE@._V1_.jpg', 'Jamie Foxx is an American actor, singer, and comedian. He won an Academy Award for Best Actor, BAFTA Award for Best Actor in a Leading Role, and Golden Globe Award for Best Actor in a Musical or Comedy, for his work in the 2004 biographical film "Ray".');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Gabrielle Union', '1973-10-29', 'Omaha, Nebraska, USA', 'nm0005517', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTkwNjUzMDM2Nl5BMl5BanBnXkFtZTcwNDgyMDY4Mg@@._V1_.jpg', 'Gabrielle Union was born on October 29, 1972, in Omaha, Nebraska, to Theresa (Glass), who managed a phone company, and Sylvester E. Union, a military sergeant and business executive. At the age of 8, her family moved to Pleasanton, California, where she grew up and attended high school.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Scoot McNairy', '1977-11-11', 'Dallas, Texas, USA', 'nm1058940', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOTUzMzc1NzM5M15BMl5BanBnXkFtZTcwNjAzOTc1NA@@._V1_.jpg', 'During the early 2000s, actor Scoot McNairy quickly came to specialize in portrayals of colorful and individualistic young men with a slightly rebellious edge. McNairy began during the early to mid-2000s, with bit parts in films including Wonderland (2003), Herbie: Fully Loaded (2005), and Art School Confidential (2006).');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Sala Baker', '1976-09-22', 'Wellington, New Zealand', 'nm1019674', 'https://images-na.ssl-images-amazon.com/images/M/MV5BODM3NzY4ODM3OF5BMl5BanBnXkFtZTcwNjk2MTc4Nw@@._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('T.I.', '1980-09-25', 'Atlanta, Georgia, USA', 'nm1939267', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQzMDMwNjkxN15BMl5BanBnXkFtZTcwMDI0MTM5OA@@._V1_.jpg', 'T.I. was born Clifford Joseph Harris, Jr. on September 25, 1980, in Atlanta, Georgia, to Violeta Morgan and Clifford "Buddy" Harris, Sr. He is also known as T.I.P. and "Rubberband Man". T.I. is from the streets of Westside Bankhead Zone 1 in Atlanta. His original stage name, T.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Kimberly Battista', 'Unknown', '', 'nm6584813', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ3MTYzNjIwMF5BMl5BanBnXkFtZTgwMDY5NjA4ODE@._V1_.jpg', 'Kimberly Battista is a professional model and actress signed with J. Pervis Talent and CLICK Models, Atlanta and Hutson Talent, VA.She was recently awarded the honor of being named CLICK\'s Lifestyle Model of the Year. Kim was born and raised in the Panhandle of Florida and is known for her fun and easy going attitude.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Octavius J. Johnson', 'Unknown', '', 'nm3422950', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTgwMDIzNjY3MV5BMl5BanBnXkFtZTgwNTQ4OTA5NDE@._V1_.jpg', 'Octavius J. Johnson is an actor, singer, and musician. As a native of Baltimore, Maryland, Octavius discovered his passion for acting when he was cast as a featured extra on the HBO television series \'The Wire.\'This life changing experience, which ignited an interest in him to become an entertainer, was nurtured through extensive training and various acting and musical performance opportunities.');
