INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Carla Shinall', 'Unknown', '', 'nm7079992', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjg0YmJiZDUtN2UwMS00MzdhLTk2OWEtOTZhNTIyMGFkM2Y1L2ltYWdlXkEyXkFqcGdeQXVyNTgxNTM5MDc@._V1_.jpg', 'Carla Shinall was born on March 3, 1982, in Cartersville, Georgia. She attended Cass High School where she was a member of the marching band, dance team, and drama club. She became a certified nursing assistant in 2000 shortly after finishing high-school.');
