INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Steve Coulter', 'Unknown', '', 'nm0183548', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMGU5NDcwMGYtZGQ1OC00MGJkLWJhNzctYzQ5ZTgyZjA2NjJjL2ltYWdlXkEyXkFqcGdeQXVyODQzNzUxNQ@@._V1_.jpg', 'A graduate of the North Carolina School of the Arts, Steve recently appeared in Hangman with Al Pacino. Other credits include Abundant Acreage Available, Coach Pom Pom in Hank Azaria\'s Brockmire, HBO\'s The Wizard of Lies, House of Cards, The Birth of a Nation, and Reg Monroe on AMC\'s The Walking Dead.');
