INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Ric Reitz', '1955-09-08', 'Rochester, New York, USA', 'nm0718680', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMmRjNjZjMDQtYmM0Yy00NzFmLWFiODAtM2UxMDVmYzllMzZhL2ltYWdlXkEyXkFqcGdeQXVyMjAxNjMzNA@@._V1_.jpg', 'Ric is an actor, writer, composer, director and producer who has been active in show business for more than 40 years. Born in Rochester, New York, he attended Bowling Green State Univeristiy in Ohio and graduated with honors in Radio-TV-Film, Theater and Marketing.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Inder Kumar', 'Unknown', '', 'nm5548632', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTY2NTc2MTA4MF5BMl5BanBnXkFtZTgwMjcxNDU0NDE@._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Richard Nunez', 'Unknown', '', 'nm4725561', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTAxMTE5MTMzOF5BMl5BanBnXkFtZTgwODQ3NDYwNzE@._V1_.jpg', 'Texas-native Richard Nunez was born and raised in El Paso, TX. He moved to Los Angeles in 2008 at the age of 21 to pursue a stunt career. Richard Nunez is known for his diverse array of ethnic "looks". He Plays Middle Eastern and Hispanic roles most of the time but has played a good guy and secret service agent once or twice in his career.');
