INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Hans Marrero', 'Unknown', '', 'nm3450086', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjMwNjg5NjYxMV5BMl5BanBnXkFtZTgwNDY1Mzc0MjE@._V1_.jpg', 'Born in 1985 in Beaufort, South Carolina, Marrero\'s upbringing was defined by discipline and structure. Son of Dr. Myra Ancheta (United States Marine Corps Retired), former Marine Corps and Naval Officer, and Hans Marrero Sr. (United States Marine Corps Retired).');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Alex Collins', 'Unknown', '', 'nm1180204', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjM1NzAzOTg5NF5BMl5BanBnXkFtZTgwNjkwODMxOTE@._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Matt Mercurio', 'Unknown', '', 'nm4948941', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTAxNzM1NDc1OTJeQTJeQWpwZ15BbWU4MDYzMTYwNjcx._V1_.jpg', 'Matt Mercurio is a theatrically trained stage and film actor. His recent film credits include supporting roles in films with such names as Academy Award-winning director Ang Lee, Tom Cruise, Jennifer Garner, Donald Sutherland and Academy Award-winners Jamie Foxx and Helen Mirren.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Aaron Wiggins', 'Unknown', '', 'nm5045622', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjMzOTQyMDU3NV5BMl5BanBnXkFtZTcwMTg2MzMzOA@@._V1_.jpg', 'Born in Chicago, Illinois and raised in Cincinnati, OH Aaron Wiggins (Aaron J. Wiggins) excelled in the playing fields and shined under the bright lights of athletics and academia. As a graduate of Morgan State University he was a 3 Year All-American Offensive Lineman majoring in sociology.');
