INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('RJ Shearer', 'Unknown', '', 'nm5886497', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTA0MzIzOTU2NjheQTJeQWpwZ15BbWU4MDcxNDk5NDAy._V1_.jpg', 'An American actor, RJ Shearer grew up in Atlanta Georgia and is best known for his role as high school bully Chuck in the movie adaptation of the bestselling John Green novel Paper Towns (2015). Other roles include awkward teenager Albert in The DUFF (2015), "Cheese" in the indie thriller Beacon Point (2016) and Zak in the upcoming Jamie Foxx movie Sleepless Night (2016).');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Matt Cornwell', 'Unknown', '', 'nm1494966', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTc2MzA2NDQzNF5BMl5BanBnXkFtZTgwODE4OTQwNjE@._V1_.jpg', 'Matthew is a textbook introvert. He has a nonchalant air about him, but it\'s a highly calculated nonchalance. He\'s been acting since high school, and picked up a Masters Degree in Mechanical Engineering along the way. He\'s called Atlanta home since 2000.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('DuRa Brown', 'Unknown', '', 'nm6790757', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ5NTM5NTY4M15BMl5BanBnXkFtZTgwNjA0ODYzNTE@._V1_.jpg', 'DuRa Brown is a trained A&P and avionic technician who recently returned to his childhood passion of acting. DuRa was born in Chicago IL in 1975, the eldest of three siblings, he has two sisters. DuRa was always a natural performer and began acting and performing in church as small child.');
