INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Tsuyoshi Abe', '1965-10-31', 'Japan', 'nm0008387', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA5ODIzMDQxNV5BMl5BanBnXkFtZTcwNzUyOTQ4OA@@._V1_.jpg', 'Tsuyoshi Abe was born and raised in Japan. He studied many martial arts including karate, kendo, and shorinji kenpo until his departure for the U.S. in 1985. He lived in Seattle, Washington and while there, studied in Bruce Lee\'s martial art, Jun Fan Gung Fu / Jeet Kune Do, under Taky Kimura.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Jennifer Badger', '1976-11-24', 'Bartow, Florida, USA', 'nm0046087', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTc4NjU2MzAzOF5BMl5BanBnXkFtZTgwMjA4Mzg1OTE@._V1_.jpg', 'Jennifer began in the industry in 1990 as an actress and quickly found her athletic background put to use in the stunt department. A Florida native, she worked on several east coast productions before relocating to Los Angeles in 1996. Since then, she has doubled for some of Hollywood\'s top stars including Angelina Jolie, Courteney Cox, Drew Barrymore, Eliza Dushku, Jennifer Lopez and more.');
