INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Danielle Burgio', 'Unknown', 'Greensboro, North Carolina, USA', 'nm0121413', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTY5NDUxMzgxMl5BMl5BanBnXkFtZTgwNjM5Nzc1MzE@._V1_.jpg', 'Danielle Burgio\'s diverse talents have led her down an exciting path from Broadway dancer to top Hollywood stunt woman, to up-and-coming actress of the moment, and as that path continues to wind and take its turns, the future can only be golden for this very talented young woman.');
